import alert from '../images/alert.png'

let style = {
    width: 60,
    backgroundColor: "#063b50",
    borderRadius: '5px 0 0 0',
    marginRight: 2,
    cursor: 'pointer',
}


export default function Alerts() {
    return (
        <div style={style}>
            <img style={{transform: 'scale(.1)', width: 18, margin: '5px auto', display: 'flex'}} src={alert} alt=''/>
        </div>
    )
}
